900c0b0ebb125e163eaec6d28782f5c\",\"title\":\"\",\"testimonials_style\":\"second-style\",\"testimonials_slider\":[{\"content\":\"In our opinion, Tanyo conducted his tasks in an excellent way. He was appreciated by his colleagues and showed a great attitude towards work. I would recommend Tanyo for a similar position based on his professional and personal skills.\\r\\nRecomendation: https:\\/\\/tanyoivanov.net\\/files\\/recomendations\\/AndersPersson.pdf\",\"author_avatar\":{\"attachment_id\":\"176\",\"url\":\"\\/\\/tanyo\\/wp-content\\/uploads\\/2021\\/12\\/anders.jpg\"},\"author_name\":\"Anders Person\",\"author_company\":\"Comstream\",\"site_url\":\"https:\\/\\/comstream.eu\\/\",\"target\":\"_blank\"},{\"content\":\"Tanyo was with us for long time and contributed to an important project in our company. He gave some creative ideas and stayed in touch after leaving the company. Recommendation: https:\\/\\/tanyoivanov.net\\/files\\/recomendations\\/IvayloIvanov.pdf\",\"author_avatar\":{\"attachment_id\":\"177\",\"url\":\"\\/\\/tanyo\\/wp-content\\/uploads\\/2021\\/12\\/ivo.jpg\"},\"author_name\":\"Ivaylo Ivanov\",\"author_company\":\"BGO Software\",\"site_url\":\"https:\\/\\/www.bgosoftware.com\\/\",\"target\":\"_blank\"},{\"content\":\"Tanyo would be a good part in every team as he was an important part of our. I would definitely recommend Tanyo to his next employers. Recomendation: https:\\/\\/tanyoivanov.net\\/files\\/recomendations\\/IvanLekushev.pdf\",\"author_avatar\":{\"attachment_id\":\"178\",\"url\":\"\\/\\/tanyo\\/wp-content\\/uploads\\/2021\\/12\\/ivan.jpg\"},\"author_name\":\"Ivan Lekushev\",\"author_company\":\"BGO Software\",\"site_url\":\"https:\\/\\/www.bgosoftware.com\\/\",\"target\":\"_blank\"}],\"items\":\"2\",\"items_tablet\":\"2\",\"items_mobile\":\"1\",\"loop\":\"off\",\"autoplay\":{\"autoplay_switcher\":\"off\",\"on\":{\"autoplay_tablet\":\"off\",\"autoplay_timeout\":\"5000\",\"smart_speed\":\"1000\"}},\"by_page\":\"1\"}}]},{\"type\":\"column\"