s role, I was responsible for the software development and maintenance of a public portal (https:\\/\\/harp.org.uk) of the NHS related to health researches. My main daily tasks included bug fixing, new features development, helpdesk tickets handling, client - team communication and planning, junior developers introduction.<br \\/><strong>Tech:<\\/strong>&nbsp;ASP.NET MVC\\/WebForms, SQL Server, EF, jQuery, Ace Admin, Bootstrap, CI\\/CD, Jira<\\/p>\",\"logo\":{\"attachment_id\":\"190\",\"url\":\"\\/\\/tanyo\\/wp-content\\/uploads\\/2021\\/12\\/download-1.png\"},\"period_color\":\"#9bd952\"},{\"id\":\"b352080e6817edc61ca2ec2d14cf7d72\",\"period\":\"Jun 2015- Jun 2016\",\"title\":\".NET Developer \\u2013 Sweden, Gothenburg\",\"subtitle\":\"Comstream\",\"text\":\"<p>Worked in the client location in Gothenburg on an ASP.NET MVC installer application of IoT devices who decreases the buildings overall energy consumption.I was responsible for the application development and mentoring of a junior developer.<br \\/><strong>Tech:<\\/strong>&nbsp;ASP.NET MVC, Angular.js, SQL Server, Entity Framework, JavaScript, Bootstrap<\\/p>\",\"logo\":{\"attachment_id\":\"189\",\"url\":\"\\/\\/tanyo\\/wp-content\\/uploads\\/2021\\/12\\/download.png\"},\"period_color\":\"#9bd952\"},{\"id\":\"ad7d222bd5774033945ddd56f39090c4\",\"period\":\"Jan 2013- Jun 2015\",\"title\":\".NET Developer - Remote\",\"subtitle\":\"BuCons\",\"text\":\"<p>Developed, documented and delivered a lot of small applications like webshops, windows services, etc. The main application was a Desktop Win Forms application used for the administration of the scores and profiles of the students.Worked with the team of HSO from Switzerland remotely until the delivery. Trained a junior.Waterfall methodology.<br \\/><strong>Tech:<\\/strong>&nbsp;AWS, WinForms, DotNet Bar, WPF, XBAP ASP.NET MVC\\/WebForms, DotNetNuke, SQL Server, Entity Framework<\\/p>\",\"logo\":{\"attachment_id\":\"188\",\"url\":\"\\/\\/tanyo\\/wp-content\\/uplo