3985f622d9e504d74\",\"period\":\"2005 - 2009\",\"title\":\"Information Technologies\",\"subtitle\":\"Asen Zlatarov\\u2019s High School \\u2013 Parvomay\",\"text\":\"<p>Basic Programming (A), Microsoft Office (A), 3D Software and design (A)<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"}]}},{\"type\":\"simple\",\"shortcode\":\"divider\",\"atts\":{\"style\":{\"ruler_type\":\"space\",\"space\":{\"height\":\"30\"}}}},{\"type\":\"simple\",\"shortcode\":\"block_title\",\"atts\":{\"block_id\":\"\",\"title\":\"Experience\",\"color_title_part\":\"\",\"description\":\"\"}},{\"type\":\"simple\",\"shortcode\":\"timeline\",\"atts\":{\"title\":\"\",\"timeline_style\":\"timeline-second-style\",\"timeline\":[{\"id\":\"357e35775b593b9457d66a0754defe8b\",\"period\":\"Feb 2020 - Jul 2020\",\"title\":\"Full Stack .NET Developer - Remote Contractor\",\"subtitle\":\"OneDigital Tech\",\"text\":\"<p>In my role at OneDigital Tech, I worked on an existing API for the invoicing of cargo ships. My main duty was to change the way of invoicing and to introduce new charges to the system.I also took part in the Angular 8 front - end layer development and sprints planning.<br \\/><strong>Tech:<\\/strong>&nbsp;ASP.NET Core Web API, Angular 8, Angular Material, Entity Framework Core, SQL Server<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"55115f43a77e37767c620c728bb5d469\",\"period\":\"Jan 2019 - Dec 2019\",\"title\":\"Application Developer - UK, London\",\"subtitle\":\"Foster + Partners\",\"text\":\"<p>Took an important part of the development and testing of the new Intranet and all the accompanying applications(~20).My role also included helpdesk tickets handling, new internal microservice development, everyday communication with the employees.Impeccable knowledge in many technologies was key to this position.I left purely because of family reasons.<br \\/><strong>Tech:<\\/strong>&nbsp;ASP.NET Core MVC\\/Web API, ASP.NET WebForms\\/MVC, WinForms, Azure, Vue.js, Umbraco, Selenium, xUnit Tests, SQL Server, EntityFramework Core, Bootstrap, jQuery<\\/p>\",\"logo\":{\"attachment_id\":\"191\",\"url\":\"\\/\\/tanyo\\/wp-content\\/uploads\\/2021\\/12\\/download-2.png\"},\"period_color\":\"#9bd952\"},{\"id\":\"6825a40077c452d5732a8552077fd32f\",\"period\":\"Jun 2016 - Nov 2018\",\"title\":\"Senior .NET Developer  - Bulgaria, Plovdiv\",\"subtitle\":\"BGO Software\",\"text\":\"<p>In this role, I was responsible for the software development and maintenance of a public portal (https:\\/\\/harp.org.uk) of the NHS related to health researches. My main daily tasks included bug fixing, new features development, helpdesk tickets handling, client - team communication and planning, junior developers introduction.<br \\/><strong>Tech:<\\/strong>&nbsp;ASP.NET MVC\\/WebForms, SQL Server, EF, jQuery, Ace Admin, Bootstrap, CI\\/CD, Jira<\\/p>\",\"logo\":{\"attachment_id\":\"190\",\"url\":\"\\/\\/tanyo\\/wp-content\\/uploads\\/2021\\/12\\/download-1.png\"},\"period_color\":\"#9bd952\"},{\"id\":\"b352080e6817edc61ca2ec2d14cf7d72\",\"period\":\"Jun 2015- Jun 2016\",\"title\":\".NET Developer \\u2013 Sweden, Gothenburg\",\"subtitle\":\"Comstream\",\"text\":\"<p>Worked in the client location in Gothenburg on an ASP.NET MVC installer application of IoT devices who decreases the buildings overall energy consumption.I was responsible for the application development and mentoring of a junior developer.<br \\/><strong>Tech:<\\/strong>&nbsp;ASP.NET MVC, Angular.js, SQL Server, Entity Framework, JavaScript, Bootstrap<\\/p>\",\"logo\":{\"attachment_id\":\"189\",\"url\":\"\\/\\/tanyo\\/wp-content\\/uploads\\/2021\\/12\\/download.png\"},\"period_color\":\"#9bd952\"},{\"id\":\"ad7d222bd5774033945ddd56f39090c4\",\"period\":\"Jan 2013- Jun 2015\",\"title\":\".NET Developer - Remote\",\"subtitle\":\"BuCons\",\"text\":\"<p>Developed, documented and delivered a lot of small applications like webshops, windows services, etc. The main application was a Desktop Win Forms application used for the administration of the scores and profiles of the students.Worked with the team of HSO from Switzerland remotely until the delivery. Trained a junior.Waterfall methodology.<br \\/><strong>Tech:<\\/strong>&nbsp;AWS, WinForms, DotNet Bar, WPF, XBAP ASP.NET MVC\\/WebForms, DotNetNuke, SQL Server, Entity Framework<\\/p>\",\"logo\":{\"attachment_id\":\"188\",\"url\":\"\\/\\/tanyo\\/wp-content\\/uploads\\/2021\\/12\\/bucons-1.jpg\"},\"period_color\":\"#9bd952\"}]}}]},{\"type\":\"column\",\"width\":\"1_3\",\"atts\":{\"id\":\"cb8a2d7a43ffa4c8a40b455448316734\",\"html_label\":\"\",\"padding_top\":\"0\",\"padding_right\":\"0\",\"padding_bottom\":\"0\",\"padding_left\":\"0\",\"tablet\":\"\",\"class\":\"\"},\"_items\":[{\"type\":\"simple\",\"shortcode\":\"block_title\",\"atts\":{\"block_id\":\"\",\"title\":\"Design Skills\",\"color_title_part\":\"\",\"description\":\"\"}},{\"type\":\"simple\",\"shortcode\":\"skills\",\"atts\":{\"title\":\"\",\"skills_style\":\"skills-second-style\",\"skills\":[{\"id\":\"dac73e965e9f4777e57fa89ede187ab8\",\"title\":\"Front-End\",\"value\":\"80\",\"color\":\"#0099e5\"},{\"id\":\"6d714613be79f0b599436796c7d25444\",\"title\":\"Back-End\",\"value\":\"90\",\"color\":\"#0099e5\"},{\"id\":\"40cafd150cc54bf4db0fab34ef764fae\",\"title\":\"Databases\",\"value\":\"75\",\"color\":\"#0099e5\"},{\"id\":\"7ad022f1fb26ea8e1a164ee5115e9d82\",\"title\":\"Web Development\",\"value\":\"90\",\"color\":\"#0099e5\"},{\"id\":\"8acddaaf17f0bdbdd25a31a4e9076096\",\"title\":\"Desktop Development\",\"value\":\"70\",\"color\":\"#0099e5\"}]}},{\"type\":\"simple\",\"shortcode\":\"block_title\",\"atts\":{\"block_id\":\"\",\"title\":\"Coding Skills\",\"color_title_part\":\"\",\"description\":\"\"}},{\"type\":\"simple\",\"shortcode\":\"skills\",\"atts\":{\"title\":\"\",\"skills_style\":\"skills-second-style\",\"skills\":[{\"id\":\"ffc0c0eb95eca18bf4c6ff0a75020adf\",\"title\":\"JavaScript\",\"value\":\"95\",\"color\":\"#0099e5\"},{\"id\":\"8cfe7b82b5dd93334224bbe9f283e2f