INSERT INTO `wp_posts` VALUES (2,1,'2018-04-05 09:11:12','2018-04-05 09:11:12','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://tanyo/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2018-04-05 09:11:12','2018-04-05 09:11:12','',0,'http://tanyo/?page_id=2',0,'page','',0),(4,1,'2018-04-05 09:52:34','2018-04-05 09:52:34','<section class=\"fw-main-row \">\n	<div class=\"fw-container\">\n		<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-12 \">\r\n    <div id=\"col_inner_id-61c8af6c595f8\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n<div class=\"block-title\">\n    <h3>What I Do<span></span></h3>\n</div>\n	</div>\r\n</div>\r\n</div>\n\n<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-6 \">\r\n    <div id=\"col_inner_id-61c8af6c596a5\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n<div id=\"info-list-61c8af6c59717\" class=\"info-list-w-icon\">\n	\n					<div id=\"info_block_with_icon_b015ffdcdf57b8661f49b3aef80e1ff8\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"fa fa-code\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>Custom Software Development</h4>\n		        <p>Web, Desktop and Mobile Development. Software architecture, optimisation, automated testing, components development, bug-fixing, servers management and much more...</p>\n		    </div>\n		</div>\n					<div id=\"info_block_with_icon_edf44ebb83ebf054b9e3701d2bdd98ed\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"linecons linecons-study\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>Personal Training</h4>\n		        <p>Teaching of new staff, preparation of learning materials and documentation. Tasks and tickets management, low-level project management and much more...</p>\n		    </div>\n		</div>\n	</div>\n	</div>\r\n</div>\r\n\r\n\r\n<div class=\" col-xs-12 col-sm-6 \">\r\n    <div id=\"col_inner_id-61c8af6c597af\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n<div id=\"info-list-61c8af6c59800\" class=\"info-list-w-icon\">\n	\n					<div id=\"info_block_with_icon_93f16f5f0404768b10065923be4924e2\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"dashicons dashicons-wordpress\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>CMS Development</h4>\n		        <p>Deployment, configuration and development of components for CMS systems. Preparation for production usage, users management, testing, security and much more...</p>\n		    </div>\n		</div>\n					<div id=\"info_block_with_icon_387057d50e69d1d6a1fa6ec9f413aef6\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"lnr lnr-pie-chart\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>Software Architecture and Design</h4>\n		        <p>Planing of the software architecture and design. Drawing of the dependencies and relations between different micro-services. </p>\n		    </div>\n		</div>\n	</div>\n	</div>\r\n</div>\r\n</div>\n\n<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-12 \">\r\n    <div id=\"col_inner_id-61c8af6c598ad\" class=\"fw-col-inner\" data-paddings=\"20px 0px 40px 0px\">\r\n		\n<div class=\"block-title\">\n    <h3>Testimonials<span></span></h3>\n</div>\n\n\n<div id=\"testimonials_b278f99c5a7261835c83fde78928c81e\" class=\"testimonials owl-carousel \n	testimonials-loop-off \n	autoplay-off	\" data-mobile-items=\"1\" data-tablet-items=\"2\" data-items=\"2 \" data-by-page=\"1\">\n\n			<!-- Testimonial testimonials-61c8af6c5993b -->\n		<div class=\"testimonial-item testimonial-testimonials-61c8af6c5993b\">\n\n			<!-- Testimonial Content -->\n			<div class=\"testimonial-content\">\n				<div class=\"testimonial-text\">\n                    					   <p>In our opinion, Tanyo conducted his tasks in an excellent way. He was appreciated by his colleagues and showed a great attitude towards work. I would recommend Tanyo for a similar position based on his professional and personal skills.\r\nRecomendation: https://tanyoivanov.net/files/recomendations/AndersPersson.pdf</p>\n                    				</div>\n			</div>            \n			<!-- /Testimonial Content -->\n\n			<!-- Testimonial Author -->\n			<div class=\"testimonial-credits\">\n				<!-- Picture -->\n				<div class=\"testimonial-picture\">\n										<img src=\"//tanyo/wp-content/uploads/2021/12/anders.jpg\" alt=\"Anders Person\" />\n				</div>              \n				<!-- /Picture -->\n				<!-- Testimonial author information -->\n				<div class=\"testimonial-author-info\">\n					<p class=\"testimonial-author\">Anders Person</p>\n																									<p class=\"testimonial-firm\"><a href=\"https://comstream.eu/\" target=\"_blank\" rel=\"noopener\">Comstream</a></p>\n															</div>\n			</div>\n			<!-- /Testimonial author information -->  \n  \n		</div>\n		<!-- End of Testimonial testimonials-61c8af6c5993b -->\n			<!-- Testimonial testimonials-61c8af6c5993b -->\n		<div class=\"testimonial-item testimonial-testimonials-61c8af6c5993b\">\n\n			<!-- Testimonial Content -->\n			<div class=\"testimonial-content\">\n				<div class=\"testimonial-text\">\n                    					   <p>Tanyo was with us for long time and contributed to an important project in our company. He gave some creative ideas and stayed in touch after leaving the company. Recommendation: https://tanyoivanov.net/files/recomendations/IvayloIvanov.pdf</p>\n                    				</div>\n			</div>            \n			<!-- /Testimonial Content -->\n\n			<!-- Testimonial Author -->\n			<div class=\"testimonial-credits\">\n				<!-- Picture -->\n				<div class=\"testimonial-picture\">\n										<img src=\"//tanyo/wp-content/uploads/2021/12/ivo.jpg\" alt=\"Ivaylo Ivanov\" />\n				</div>              \n				<!-- /Picture -->\n				<!-- Testimonial author information -->\n				<div class=\"testimonial-author-info\">\n					<p class=\"testimonial-author\">Ivaylo Ivanov</p>\n																									<p class=\"testimonial-firm\"><a href=\"https://www.bgosoftware.com/\" target=\"_blank\" rel=\"noopener\">BGO Software</a></p>\n															</div>\n			</div>\n			<!-- /Testimonial author information -->  \n  \n		</div>\n		<!-- End of Testimonial testimonials-61c8af6c5993b -->\n			<!-- Testimonial testimonials-61c8af6c5993b -->\n		<div class=\"testimonial-item testimonial-testimonials-61c8af6c5993b\">\n\n			<!-- Testimonial Content -->\n			<div class=\"testimonial-content\">\n				<div class=\"testimonial-text\">\n                    					   <p>Tanyo would be a good part in every team as he was an important part of our. I would definitely recommend Tanyo to his next employers. Recomendation: https://tanyoivanov.net/files/recomendations/IvanLekushev.pdf</p>\n                    				</div>\n			</div>            \n			<!-- /Testimonial Content -->\n\n			<!-- Testimonial Author -->\n			<div class=\"testimonial-credits\">\n				<!-- Picture -->\n				<div class=\"testimonial-picture\">\n										<img src=\"//tanyo/wp-content/uploads/2021/12/ivan.jpg\" alt=\"Ivan Lekushev\" />\n				</div>              \n				<!-- /Picture -->\n				<!-- Testimonial author information -->\n				<div class=\"testimonial-author-info\">\n					<p class=\"testimonial-author\">Ivan Lekushev</p>\n																									<p class=\"testimonial-firm\"><a href=\"https://www.bgosoftware.com/\" target=\"_blank\" rel=\"noopener\">BGO Software</a></p>\n															</div>\n			</div>\n			<!-- /Testimonial author information -->  \n  \n		</div>\n		<!-- End of Testimonial testimonials-61c8af6c5993b -->\n	</div>\n	</div>\r\n</div>\r\n</div>\n\n<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-12 \">\r\n    <div id=\"col_inner_id-61c8af6c59a98\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n<div class=\"block-title\">\n    <h3>Clients<span></span></h3>\n</div>\n\n<div id=\"clients_8b59165775df4d1577c689ff0ed62c09\" class=\"clients owl-carousel \n	clients-loop-off \n	autoplay-off	\" data-mobile-items=\"2\" data-tablet-items=\"1\" data-items=\"1\" data-by-page=\"1\">\n\n			<div class=\"client-block\">\n										<a href=\"#\" target=\"_blank\" title=\"Logo\" rel=\"noopener\">\n			\n								<img src=\"//tanyo/wp-content/uploads/2018/04/client.png\" alt=\"Logo\">\n\n						</a>\n					</div>\n	\n</div>\n	</div>\r\n</div>\r\n</div>\n\n	</div>\n</section>\n\n\n<!-- b4c32eabe4d9daa2dd9dd9a311e765b7 -->','About Me','','publish','closed','closed','','about-me','','','2021-12-26 18:07:40','2021-12-26 18:07:40','',0,'http://tanyo/?page_id=4',0,'page','',0),(14,1,'2018-04-05 09:53:14','2018-04-05 09:53:14','<section class=\"fw-main-row \">\n	<div class=\"fw-container\">\n		<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-12 \