Designs</h4></a>\n                            </div>\n                          </div>\n                        </div>\n                        <!-- End of Blog Post 86 -->\n                                            <!-- Blog Post 82 -->\n                        <div class=\"item post-82\">\n                          <div class=\"blog-card\">\n                            <div class=\"media-block\">\n                                <div class=\"category\">\n                                    <a href=\"http://tanyo/category/design/\" title=\"View all posts in Design\">Design</a>                                </div>\n                                <a href=\"http://tanyo/6-easy-steps-to-better-icon-design/\">\n                                                                        \n                                                <img src=\"http://tanyo/wp-content/uploads/2018/04/blog_image_2-811x372.jpg\" alt=\"image\" />\n                                                                                    <div class=\"mask\"></div>\n                                </a>\n                            </div>\n                            <div class=\"post-info\">\n                                <div class=\"post-date\">06 Apr 2018</div>\n                                <a href=\"http://tanyo/6-easy-steps-to-better-icon-design/\"><h4 class=\"blog-item-title\">6 Easy Steps to Better Icon Design</h4></a>\n                            </div>\n                          </div>\n                        </div>\n                        <!-- End of Blog Post 82 -->\n                    </div>\n\n            <a class=\"btn btn-primary\" href=\"http://tanyo/blog/\">See All Posts</a>\n        	</div>\r\n</div>\r\n</div>\n\n	</div>\n</section>\n\n\n<!-- 3aaef368b4c1948d580d2bff1d583e04 -->','Posts','','publish','closed','closed','','posts','','','2020-12-23 11:41:31','2020-12-23 11:41:31','',0,'http://tanyo/?page_id=17',0,'page','',0),(20,1,'2018-04-05 09:54:15','2018-04-05 09:54:15