lopment, helpdesk tickets handling, client - team communication and planning, junior developers introduction.<br /><strong>Tech:</strong>&nbsp;ASP.NET MVC/WebForms, SQL Server, EF, jQuery, Ace Admin, Bootstrap, CI/CD, Jira</p>				</div>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">Jun 2016 - Nov 2018</h5>\n				<span class=\"item-company\">Comstream</span>\n								<span class=\"item-logo\"><img src=\"//tanyo/wp-content/uploads/2021/12/download.png\" alt=\"image\" /></span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">.NET Developer  Sweden, Gothenburg</h4>\n				<div class=\"text\">\n					<p>Worked in the client location in Gothenburg on an ASP.NET MVC installer application of IoT devices who decreases the buildings overall energy consumption.I was responsible for the application development and mentoring of a junior developer.<br /><strong>Tech:</strong>&nbsp;ASP.NET MVC, Angular.js, SQL Server, Entity Framework, JavaScript, Bootstrap</p>				</div>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">Jun 2015- Jun 2016</h5>\n				<span class=\"item-company\">BuCons</span>\n								<span class=\"item-logo\"><img src=\"//tanyo/wp-content/uploads/2021/12/bucons-1.jpg\" alt=\"image\" /></span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">.NET Developer - Remote</h4>\n				<div class=\"text\">\n					<p>Developed, documented and delivered a lot of small applications like webshops, windows services, etc. The main application was a Desktop Win Forms application used for the administration of the scores and profiles of the students.Worked with the team of HSO from Switzerland remotely until the delivery. Trained a junior.Waterfall methodology.<br /><strong>Tech:</strong>&nbsp;AWS, WinForms, DotNet Bar, WPF, XBAP ASP.NET MVC/WebForms, DotNetNuke, SQL Server, Entity Framework</p>				</div>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">Jan 2013- Jun 2015</h5>\n				<span class=\"item-company\">Foster + Partners</span>\n								<span class=\"item-logo\"><img src=\"//tanyo/wp-content/uploads/2021/12/download-2.png\" alt=\"image\" /></span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Application Developer - UK, London</h4>\n				<div class=\"text\">\n					<p>Took an important part of the development and testing of the new Intranet and all the accompanying applications(~20).My role also included helpdesk tickets handling, new internal microservice development, everyday communication with the employees.Impeccable knowledge in many technologies was key to this position.I left purely because of family reasons.<br /><strong>Tech:</strong>&nbsp;ASP.NET Core MVC/Web API, ASP.NET WebForms/MVC, WinForms, Azure, Vue.js, Umbraco, Selenium, xUnit Tests, SQL Server, EntityFramework Core, Bootstrap, jQuery</p>				</div>\n			</div>\n		</div>\n			</div>\n	</div>\r\n</div>\r\n\r\n\r\n<div class=\" col-xs-12 col-sm-4 \">\r\n    <div id=\"col_inner_id-61c8b4f0552d6\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n<div class=\"block-title\">\n    <h3>Design Skills<span></span></h3>\n</div>\n\n\n<div id=\"skills-61c8b4f05537c\" class=\"skills-info skills-second-style\">\n						<div class=\"clearfix\">\n				<h4>Web Design</h4>\n				<div class=\"skill-value\">95%</div>\n			</div>\n			<div id=\"skill-6169628e9807159992469359bbf1e752\" data-value=\"95\" data-color=\"#0099e5\" class=\"skill-container\">\n				<div class=\"skill-percentage\"></div>\n			</div>\n								<div class=\"clearfix\">\n				<h4>Print Design</h4>\n				<div class=\"skill-value\">65%</div>\n			</div>\n			<div id=\"skill-c1b252e0776d1f9cb3b034e47143b501\"