, CI/CD, Jira</p>				</div>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">Jun 2015- Jun 2016</h5>\n				<span class=\"item-company\">Comstream</span>\n								<span class=\"item-logo\"><img src=\"//tanyo/wp-content/uploads/2021/12/download.png\" alt=\"image\" /></span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">.NET Developer  Sweden, Gothenburg</h4>\n				<div class=\"text\">\n					<p>Worked in the client location in Gothenburg on an ASP.NET MVC installer application of IoT devices who decreases the buildings overall energy consumption.I was responsible for the application development and mentoring of a junior developer.<br /><strong>Tech:</strong>&nbsp;ASP.NET MVC, Angular.js, SQL Server, Entity Framework, JavaScript, Bootstrap</p>				</div>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">Jan 2013- Jun 2015</h5>\n				<span class=\"item-company\">BuCons</span>\n								<span class=\"item-logo\"><img src=\"//tanyo/wp-content/uploads/2021/12/bucons-1.jpg\" alt=\"image\" /></span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">.NET Developer - Remote</h4>\n				<div class=\"text\">\n					<p>Developed, documented and delivered a lot of small applications like webshops, windows services, etc. The main application was a Desktop Win Forms application used for the administration of the scores and profiles of the students.Worked with the team of HSO from Switzerland remotely until the delivery. Trained a junior.Waterfall methodology.<br /><strong>Tech:</strong>&nbsp;AWS, WinForms, DotNet Bar, WPF, XBAP ASP.NET MVC/WebForms, DotNetNuke, SQL Server, Entity Framework</p>				</div>\n			</div>\n		</div>\n			</div>\n	</div>\r\n</div>\r\n\r\n\r\n<div class=\" col-xs-12 col-sm-4 \">\r\n    <div i