s-profile-hackaday-io-5d3fd488aef1d1.9948826215644642647166','','inherit','open','closed','','kisspng-software-developer-transparency-user-computer-prog-mrunknownpbuampaposs-profile-hackaday-io-5d3fd488aef1d1-9948826215644642647166','','','2021-12-26 20:54:15','2021-12-26 20:54:15','',0,'http://tanyo/wp-content/uploads/2021/12/kisspng-software-developer-transparency-user-computer-prog-mrunknownpbuampaposs-profile-hackaday-io-5d3fd488aef1d1.9948826215644642647166.jpg',0,'attachment','image/jpeg',0),(238,1,'2021-12-27 18:25:32','2021-12-27 18:25:32','','Tanyo_Ivanov_CV','','inherit','open','closed','','tanyo_ivanov_cv','','','2021-12-27 18:25:32','2021-12-27 18:25:32','',0,'http://tanyo/wp-content/uploads/2021/12/Tanyo_Ivanov_CV.pdf',0,'attachment','application/pdf',0),(240,1,'2021-12-28 08:01:23','2021-12-28 08:01:23','','SkillsList','','inherit','open','closed','','skillslist','','','2021-12-28 08:01:23','2021-12-28 08:01:23','',0,'http://tanyo/wp-content/uploads/2021/12/SkillsList.pdf',0,'attachment','application/pdf',0),(241,1,'2021-12-28 08:01:32','2021-12-28 08:01:32','','Brochure','','inherit','open','closed','','brochure','','','2021-12-28 08:01:32','2021-12-28 08:01:32','',0,'http://tanyo/wp-content/uploads/2021/12/Brochure.pdf',0,'attachment','application/pdf',0),(242,1,'2021-12-28 08:02:07','2021-12-28 08:02:07','','chart','','inherit','open','closed','','chart','','','2021-12-28 08:05:14','2021-12-28 08:05:14','',26,'http://tanyo/wp-content/uploads/2021/12/chart.png',0,'attachment','image/png',0),(243,1,'2021-12-28 08:04:11','2021-12-28 08:04:11','<section class=\"fw-main-row \">\n	<div class=\"fw-container\">\n		<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-8 \">\r\n    <div id=\"col_inner_id-61cac4fb4c147\" class=\"fw-col-inner\" data-paddings=\"0px 0px 30px 0px\">\r\n		\n<div class=\"block-title\">\n    <h3>Education<span></span></h3>\n</div>\n\n\n<div id=\"timeline-61cac4fb4c28e\" class=\"timeline timeline-second-style clearfix\">\n					<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">2010 - 2014</h5>\n				<span class=\"item-company\">University of Plovdiv - Plovdiv</span>\n								<span class=\"item-logo\"><img src=\"//tanyo/wp-content/uploads/2021/12/download.jpeg\" alt=\"image\" /></span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Business Information Technologies, Bachelor in Informatics</h4>\n				<div class=\"text\">\n					<p>.NET (A), Java (A), Design Patterns (A), C++ (A), Banking (A), Finance (A), Accounting (A), Excel (A)</p>				</div>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">2005 - 2009</h5>\n				<span class=\"item-company\">Asen Zlatarovs High School  Parvomay</span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Information Technologies</h4>\n				<div class=\"text\">\n					<p>Basic Programming (A), Microsoft Office (A), 3D Software and design (A)</p>				</div>\n			</div>\n		</div>\n			</div>\n\n	<div class=\"fw-divider-space\" style=\"padding-top: 30px\"></div>\n\n<div class=\"block-title\">\n    <h3>Experience<span></span></h3>\n</div>\n\n\n<div id=\"timeline-61cac4fb4c63f\" class=\"timeline timeline-second-style clearfix\">\n					<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">Feb 2020 - Jul 2020</h5>\n				<span class=\"item-company\">OneDigital Tech</span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Full Stack .NET Developer - Remote Contractor</h4>\n				<div class=\"text\">\n					<p>In my role at OneDigital Tech, I worked on an existing API for the invoicing of cargo ships. My main duty was to change the way of invoicing and to introduce new charges to the system.I also took part in the Angular 8 front - end layer development and sprints planning.<br /><strong>Tech:</strong>&nbsp;ASP.NET Core Web API, Angular 8, Angular Material, Entity Framework Core, SQL Server</p>				</div>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">Jan 2019 - Dec 2019</h5>\n				<span class=\"item-company\">Foster + Partners</span>\n								<span class=\"item-logo\"><img src=\"//tanyo/wp-content/uploads/2021/12/download-2.png\" alt=\"image\" /></span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Application Developer - UK, London</h4>\n				<div class=\"text\">\n					<p>Took an important part of the development and testing of the new Intranet and all the accompanying applications(~20).My role also included helpdesk tickets handling, new internal microservice development, everyday communication with the employees.Impeccable knowledge in many technologies was key to this position.I left purely because of family reasons.<br /><strong>Tech:</strong>&nbsp;ASP.NET Core MVC/Web API, ASP.NET WebForms/MVC, WinForms, Azure, Vue.js, Umbraco, Selenium, xUnit Tests, SQL Server, EntityFramework Core, Bootstrap, jQuery</p>				</div>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">Jun 2016 - Nov 2018</h5>\n				<span class=\"item-company\">BGO Software</span>\n								<span class=\"item-logo\"><img src=\"//tanyo/wp-content/uploads/2021/12/download-1.png\" alt=\"image\" /></span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Senior .NET Developer  - Bulgaria, Plovdiv</h4>\n				<div class=\"text\">\n					<p>In this role, I was responsible for the software development and maintenance of a public portal (https://harp.org.uk) of the NHS related to health researches. My main daily tasks included bug fixing, new features develop